experience.description:
Организация работы отдела по реализации проекта "Московское долголетие":
планирование работ в рамках проекта и обеспечение их исполнения;
организация работы с гражданами по вовлечению в Проект;
текущий контроль реализации плана работ;
организация работы ОСКАД по взаимодействию с поставщиками и их учету;
организация работы по привлечению новых участников Проекта.
Введение в эксплуатацию информационную систему (КИС)Проекта, тест мобильного приложения, выявление недочетов, багов. Работа с большим объёмом данных. Аналитика перс.данных, работа с Департаментом Информационных технологий г.Москвы.
